import React from 'react';
import {
    VictoryPie,
    VictoryBar,
    VictoryChart,
    VictoryPolarAxis,
    VictoryStack
   } from 'victory';
export default class DataTwo extends React.Component {
    render(){
        return (
            <div className="Data2">
                <h1 style={{marginTop: 50}}>???</h1>
                <PieChart/>
            </div>
        );
    }
}

let sampleDataPolar = [
    { x: 100, y: 3 },
    { x: 20, y: 2 },
    // { x: 51, y: 4 },

];

class PieChart extends React.Component {
    render(){
        return (
            <>
            <div style={{marginLeft: "30%", marginRight: "30%"}}>
                <VictoryPie
                // style={{ parent: { minWidth: "50%" }}}
                colorScale={["tomato", "orange", "gold", "cyan", "navy", "white" ]}
                data={[
                    { x: "Cats", y: 35 },
                    { x: "Dogs", y: 40 },
                    { x: "Birds", y: 55 },
                    { x: "Frogs", y: 55 },
                    { x: "Mice", y: 55 },
                    { x: "Snakes", y: 10 }
                ]}
                />
            </div>
            <div style={{marginLeft: "30%", marginRight: "30%"}}>
            <VictoryBar polar

                data={[
                    { x: 100, y: 3 },
                    { x: 20, y: 2 },
                    { x: 51, y: 4 },
                    { x: 6, y: 5 },
                    { x: 5, y: 2 },
                    { x: 5, y: 4 }
                ]}
                width={400} height={400}
                domain={{ x: [0, 360] }}
                style={{ data: { fill: "#c43a31", stroke: "black", strokeWidth: 2 } }}
            />
            </div>

            <div style={{marginLeft: "30%", marginRight: "30%"}}>
                <VictoryChart polar
                    maxDomain={{ x: 360 }}
                    height={250} width={250}
                    padding={30}
                >
                <VictoryPolarAxis dependentAxis
                    style={{
                    axis: {stroke: "none"},
                    tickLabels: { fill: "none"},
                    grid: { stroke: "grey", strokeDasharray: "4, 8" }
                    }}
                />
                <VictoryPolarAxis
                    tickValues={[0, 45, 90, 135, 180, 225, 270, 315]}
                />
                <VictoryStack
                    colorScale={["#ad1b11", "#c43a31", "#dc7a6b"]}
                    style={{ data: { width: 50} }}
                >
                    <VictoryBar data={sampleDataPolar}/>
                    <VictoryBar data={sampleDataPolar}/>
                    <VictoryBar data={sampleDataPolar}/>
                </VictoryStack>
                </VictoryChart>
            </div>


            </>
        );
    }
}
